import cRequest from '../index'

class loginRequest {
    async accountLoginAccount() {
        let data;
        await cRequest.getRequest("/1/classes/tb_user").then((res => {
            // console.log(res);
            data = res;
            // return res;
        }));
        // console.log(data)
        return data;
    }
}
export default new loginRequest();
